import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import StockMovementDashboard from './StockMovementDashboard';
import AddStockMovement from './AddStockMovement';
import EditStockMovement from './EditStockMovement';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/stockmovements" element={<StockMovementDashboard />} />
        <Route path="/add-stockmovement" element={<AddStockMovement />} />
        <Route path="/edit-stockmovement/:id" element={<EditStockMovement />} />
      </Routes>
    </Router>
  );
}

export default App;
